import React from 'react'
import { 
    BrowserRouter as Router,
    Link,
    Switch,
    Route,
} from 'react-router-dom'
import Schedule from '../Schedule/Schedule'
import AdminApp from '../Admin/Admin'

const styles = {
    backgroundColor : '#114',
    color : 'white',
    margin : 'auto',
    padding : '10px',
    position : 'fix'
}

const NavBar = props => {
    const navItems = [
        {
            title : 'Home',
            to : '/'
        },
        {
            title : 'Schedule',
            to : '/schedule'
        },
        {
            title : 'Login',
            to : '/login'
        }
    ]
    return (
        <Router>
            <Switch>
                <Route path="/login">
                    <AdminApp />
                </Route>
                <Route path="/schedule">
                    <Schedule />
                </Route>
            </Switch>
        </Router>
    )
}

export default NavBar
